      <Navbar fixed="bottom" bg="dark" variant="dark" class="footer">
        <Container>
          <Row>
            <Col className="brand">
              <Navbar.Brand href="#home">Belal Bounasri</Navbar.Brand>
            </Col>
          </Row>
          <Row>
            <Col className="copyright">
